INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 10, 10, 1, 5.41, "vo_minigame_1012_result_1002", 10, 1, 8, 1, 3001, 11300103, "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！");
