INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 10, 10, 1, 1.31, "vo_minigame_1012_result_1004", 0, 1, 10, 5, 3001, 11300105, "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！");
