INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 5, 9, 2, 2.46, "vo_minigame_1012_result_1082", 0, 1, 3, 1, 3001, 12300150, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 5, 9, 2, 2.94, "vo_minigame_1012_result_1083", 0, 1, 3, 1, 3001, 12300151, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 5, 9, 2, 4.19, "vo_minigame_1012_result_1084", 0, 1, 7, 1, 3001, 12300152, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 5, 9, 2, 0.0, "vo_minigame_1012_result_1085", 0, 1, 1, 1, 3001, 12300153, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 5, 9, 2, 2.63, "vo_minigame_1012_result_1086", 0, 1, 3, 1, 3001, 12300154, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 1, 4, 2, 5.53, "vo_minigame_1012_result_1087", 0, 1, 3, 1, 3001, 12300155, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 1, 4, 2, 0.01, "vo_minigame_1012_result_1088", 9, 1, 3, 3, 3001, 12300156, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 1, 4, 2, 4.15, "vo_minigame_1012_result_1089", 3, 1, 3, 1, 3001, 12300157, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 4, 2, 0.01, "vo_minigame_1012_result_1090", 9, 1, 9, 9, 3001, 12300158, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 4, 2, 5.37, "vo_minigame_1012_result_1091", 0, 1, 3, 1, 3001, 12300159, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 4, 2, 1.44, "vo_minigame_1012_result_1092", 0, 1, 3, 1, 3001, 12300160, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 1, 4, 2, 0.0, "vo_minigame_1012_result_1093", 0, 1, 3, 3, 3001, 12300161, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 1, 4, 2, 2.91, "vo_minigame_1012_result_1094", 3, 1, 3, 9, 3001, 12300162, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 1, 4, 2, 2.61, "vo_minigame_1012_result_1095", 0, 1, 5, 1, 3001, 12300163, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 0, 2, 3.63, "vo_minigame_1012_result_1096", 1, 1, 4, 2, 3001, 12300164, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 0, 2, 4.16, "vo_minigame_1012_result_1097", 1, 1, 6, 2, 3001, 12300165, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 0, 2, 0.01, "vo_minigame_1012_result_1098", 6, 1, 3, 3, 3001, 12300166, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 0, 0, 2, 5.75, "vo_minigame_1012_result_1099", 0, 1, 6, 2, 3001, 12300167, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 0, 0, 2, 5.64, "vo_minigame_1012_result_1100", 1, 1, 4, 2, 3001, 12300168, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 0, 0, 2, 5.73, "vo_minigame_1012_result_1101", 8, 1, 8, 4, 3001, 12300169, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 0, 0, 2, 5.32, "vo_minigame_1012_result_1102", 1, 1, 5, 3, 3001, 12300170, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！");
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 0, 0, 2, 2.37, "vo_minigame_1012_result_1103", 9, 1, 3, 9, 3001, 12300171, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！");
